import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
export default class Dashboard extends Component{
    render(){
        return(
            <div className="col-2" style={{backgroundColor: 'white',margin:"10px",marginTop:'100px'}}>
                <div style={{color: 'rosybrown', fontSize: '2rem'}}>
                <img style={{height: 10, color:"#167bff"}} src alt />
                <FontAwesomeIcon icon={["fas", "home"]} />Dashboard</div>
            </div>

        )
    }
}
